import React, { Fragment } from 'react';

const Header = () => {
    return (
        <Fragment>
           <header>
            <div class="flex items-center justify-center bg-black">
                <div><img src="/53434345.png" alt=""/></div>
                <h2 className='text-white'>Men</h2>
                <h2 className='text-white'>Women</h2>

                <div>
                </div>
                <div></div>
            </div>
           </header>
        </Fragment>
    );
};

export default Header;
